import React from 'react';

const SongList = (props) => {
  const { songList } = props;

  return (
    <div className="song-list">
      <h2>Song List</h2>
      <ul>
        {songList.map((song, index) => (
          <li key={index}>
            {song.name} - {song.artist.name}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SongList;
